(5, 8, 'Sea Planes Of LaLa Land!', '<h2><strong>SEA PLANES OF LALA LAND!</strong></h2>\r\n\r\n<h2>Welcome to LaLa Land!</h2>\r\n\r\n<p>LaLa Land is very unique and is very different from most countries of its size. 35 islands dot the mainland in the Pacific Ocean. The distances of these islands vary from 40 to 500 kilometers, from the capital city of Bathelano. Passengers come at various times and in mixed groups to Bathelano International Airport (managed by the Government of LaLa Land) on dfifferent airlines from across the globe. International passengers come here for spending their holidays in the highly rated resorts of the country.</p>\r\n\r\n<p>In the beautiful and picturesque country of LaLa Land the Westcoast Air Company (WAC) runs a seaplane operation. WAC started operations in the year 2012 and today is a cash rich company WAC is keen to expand their operations. However, the operating cost has been increasing of late because of many global issues.</p>\r\n\r\n<p>As of today, WAC has 3 sea planes (AC1, AC2 and AC3) each having a maximum capacity of 10 passengers. These seaplanes fly between the WAC Terminal in Bathelano (WACTB) and the clients&#39; resorts WAC Seaplanes take 10 minutes to cover 40 kilometers, averagely.</p>\r\n\r\n<p>Various factors impacting WAC business are:</p>\r\n\r\n<p><strong>REVENUES</strong></p>\r\n\r\n<p>WAC clients are not individuals but companies. They pay for the passenger transfer services provided by WAC. At the same time if the passengers who are transferred are not happy then WAC business would suffer. Therefore, certain service delivery parameters are treated as critical for improving revenues at WAC. One of these parameters for WAC&rsquo;s business is Passenger Waiting Time (PWT) at WACTB. WAC is keen to transfer all its passengers within 30 minutes PWT.</p>\r\n\r\n<p><strong>EXPENSES</strong></p>\r\n\r\n<p>Efficient seaplane operations are heavily dependent on aviation fuel. When the fuel prices go up the operating cost go up unless the clients are ready to bear the cost through a pass through a commercial agreement.</p>\r\n\r\n<p><strong>PROFIT OPTIMIZATION</strong></p>\r\n\r\n<p>WAC believes improving profits in optimally utilizing their processes and machines to improve profits. However, sometimes because of regulations WAC is not able to utilize all its resources the way it wants.</p>\r\n\r\n<p><strong>That was&nbsp;a brief introduction to&nbsp;WAC seaplanes. You&nbsp;will get more information as we progress.</strong></p>\r\n\r\n<p><strong>All the best!</strong></p>\r\n', 0, '2017-02-03 13:22:58', 0, 1),
(6, 8, 'Sea Planes Of LaLa Land! contd....', '<p><strong>SEA PLANES OF LALA LAND!</strong></p>\r\n\r\n<p><strong>SOLUTION DESIGN:</strong></p>\r\n\r\n<p>The participants are required to create (within the specified framework) schedules for flights of WAC with least possible cost and to deliver all the passengers at the destinations.</p>\r\n\r\n<p><strong>RULES OF THE GAME &amp; OTHER INFORMATION:</strong></p>\r\n\r\n<p>Restrictions: There are some restrictions within which the business operates and those will be notified as the game progresses</p>\r\n\r\n<p>International Flights: WLD, ASD, VFR, EMI</p>\r\n\r\n<p>Pilot Flying Hours: &nbsp;As per regulations no Pilot can fly for more than 20 hours in a week. Pilots working for WAC are ABA, COD, EFA, GHO, IJE, KLO</p>\r\n\r\n<p>Current Client Resorts: Bonafa (B), Crate (C) and Desaw (D)</p>\r\n\r\n<p>Flight Time (including taxing time) to cover 40 kilometers is 10 minutes</p>\r\n\r\n<p>Multiple Stops: &nbsp;Designing flight schedules with multiple stops is allowed</p>\r\n\r\n<p>Turn-around Time: It takes 10 minutes to drop and pick new passengers</p>\r\n\r\n<p>Passenger Waiting Time (PWT) is the time elapsed between arrival of a passenger at WAC Terminal (Bathelano) and the time the relevant flight takes-off</p>\r\n\r\n<p>Penalty: Longer than specified PWT at WAC Terminal in Bathelano will attract penalty</p>\r\n\r\n<p>Delivery: Your solution for delivering all passengers at their desired resorts should be designed within the framework of constraints provided. If any constraint has been left out by the participant then the solution will not be scored (zero)</p>\r\n\r\n<p>Best Solution: Best solution will be the one which delivers all passengers within the given framework, at minimum cost.</p>\r\n\r\n<p>Distance Chart (in kilometers from WAC Terminal in Bathelano (WACTB)):</p>\r\n\r\n<p>.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; W<strong>ACTB&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D</strong></p>\r\n\r\n<p><strong>WACTB</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 120&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 160&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 200&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>B</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 120&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80</p>\r\n\r\n<p><strong>C</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 160&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80</p>\r\n\r\n<p><strong>D</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 200&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0</p>\r\n', 0, '2017-02-03 13:23:57', 0, 1),
