(28, 8, 'Hello', '<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:350px; width:1200px\" summary=\"Many\">\r\n	<caption>Hello</caption>\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">Productive Leaderships begins in January, which is the time for players to familiarise themselves with various HR practices and the game interface. The budget, for example, can be found by clicking the icon on the desktop. 1.Click &lsquo;Ready&rsquo;, when you have selected the appropriate actions a. You can choose more than one HR action. </span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">2.A menu to select HR actions at the employee level. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">3.A menu to select development measures affecting the entire work community. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">4.A menu to select HR actions related to quality and expertise. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">5.A menu to select actions for rewarding individuals and the work community. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">6.A menu to select general good HR practices. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">7.The supervisor&rsquo;s (player&rsquo;s) reply is automatically generated, depending on the HR action selected. The supervisor&rsquo;s lines per selected HR action are shown in this field. </span></span></span><span style=\"color:#000000\"><span style=\"font-family:Calibri\"><span style=\"font-size:medium\">8.The quality of working life (QWL) shows indicators for the work community. Click the QWL field to open more detailed results related to well-being at work, finances, scores etc. a. Click the QWL window to open a new view with several alternative formats to view the results.</span></span></span></p>\r\n			</th>\r\n			<th scope=\"col\">&nbsp;</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', 0, '2017-04-07 11:55:16', 0, 1),
(29, 8, 'Pop Up Trial', '<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"height:300px; width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>...................................................</td>\r\n			<td>...................................................</td>\r\n			<td>...................................................</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"margin-left:0in; margin-right:0in\">.<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<style>\r\n/* Popup container - can be anything you want */\r\n.popup {\r\n    position: absolute;\r\n    display: inline-block;\r\n    cursor: pointer;\r\n    -webkit-user-select: none;\r\n    -moz-user-select: none;\r\n    -ms-user-select: none;\r\n    user-select: none;\r\n}\r\n\r\n/* The actual popup */\r\n.popup .popuptext {\r\n    visibility: hidden;\r\n    width: 375px;\r\n    background-color: #555;\r\n    color: #fff;\r\n    text-align: center;\r\n    border-radius: 6px;\r\n    padding: 8px 0;\r\n    position: absolute;\r\n    z-index: 1;\r\n    bottom: 125%;\r\n    left: 50%;\r\n    margin-left: -200px;\r\n}\r\n\r\n/* Popup arrow */\r\n.popup .popuptext::after {\r\n    content: \"\";\r\n    position: absolute;\r\n    top: 100%;\r\n    left: 50%;\r\n    margin-left: -5px;\r\n    border-width: 5px;\r\n    border-style: solid;\r\n    border-color: #555 transparent transparent transparent;\r\n}\r\n\r\n/* Toggle this class - hide and show the popup */\r\n.popup .show {\r\n    visibility: visible;\r\n    -webkit-animation: fadeIn 1s;\r\n    animation: fadeIn 1s;\r\n}\r\n\r\n/* Add animation (fade in the popup) */\r\n@-webkit-keyframes fadeIn {\r\n    from {opacity: 0;} \r\n    to {opacity: 1;}\r\n}\r\n\r\n@keyframes fadeIn {\r\n    from {opacity: 0;}\r\n    to {opacity:1 ;}\r\n}\r\n</style>\r\n</head>\r\n<body style=\"text-align:center\">\r\n\r\n<h2>Supervisor</h2>\r\n\r\n<div class=\"popup\" onclick=\"myFunction()\">...........Click Here!\r\n  <span class=\"popuptext\" id=\"myPopup\"> Frontline managers oversee a group of employees who perform key tasks directly related to the production of the companys final product. Very often they are preoccupied with administrative chores such as enforcing rules and regulations, creating reports, signing off approvals or attending meetings. Their jobs require them to lead and motivate a team. </span>\r\n</div>\r\n\r\n<script>\r\n// When the user clicks on div, open the popup\r\nfunction myFunction() {\r\n    var popup = document.getElementById(\"myPopup\");\r\n    popup.classList.toggle(\"show\");\r\n}\r\n</script>\r\n\r\n</body>\r\n</html>\r\n</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 0, '2017-04-10 14:27:45', 0, 0),
