(40, 12, 'Last Quarter Story (contd.)', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#000000; padding:10px\">\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"color:#ffffff\"><span style=\"font-size:22px\"><strong>SITUATION AT THE END OF LAST QUARTER</strong></span></span></p>\r\n\r\n<p><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">At the beginning of the last year, the mall management thought they were not getting the right profile of customers and that conversions from browsing to buying in the entire mall was low. So they introduced entry conditions for visitors such as possession of mobile phones, credit cards, ID cards, etc. Alternatively, an entry fee of 200 Cheries was charged on weekends which was redeemable on purchases of more than that amount. This was to prevent &lsquo;superfluous&rsquo; footfalls in the mall. This had an absolute negative impact on customers and the number of people visiting the mall dipped to an average of 4000 per day.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">The number of consumers coming to R-Store reduced because of the mall management&rsquo;s decision. Its business dipped&nbsp;by around 15% from the previous Quarter and the store found it difficult to pay to suppliers and for infrastructure. </span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n', 0, '2017-04-21 19:35:31', 0, 0),
(41, 12, 'Audio', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#000000; padding:10px\">\r\n<p style=\"text-align:center\"><span style=\"color:#ffffff\"><span style=\"font-size:22px\"><strong>SITUATION AT THE END OF LAST QUARTER (contd.)</strong></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">Three months back the store management came up with the following steps to help turn it around:</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">#Introduced a loyalty program with big benefits to the customers. This, however, did not lead to any significant business increase and raised expenditure considerably.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">#Started leasing out space to various other companies to optimize space. Consequently, employees who were afraid of losing their jobs started leaving for competing companies. By now rumors were afloat that the store format would change and hence resources may be outsourced.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">#Decided to hire candidates who are fresh from colleges and do not have any experience</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#ffffff\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">#Postponed employees&rsquo; annual increments and incentives.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n</div>\r\n\r\n', 0, '2017-04-21 19:52:49', 0, 0),
