INSERT INTO `game_scengeneral` (`ScenGen_ID`, `ScenGen_ScenID`, `ScenGen_Title`, `ScenGen_Content`, `ScenGen_PageOrder`, `ScenGen_DateTime`, `ScenGen_Status`, `ScenGen_Delete`) VALUES
(2, 7, 'SCHEDULE ONEFast Forward', '<p><strong>SCHEDULE ONE</strong><strong>&mdash;Fast Forward</strong></p>\r\n\r\n<p><strong>20th January 2018</strong></p>\r\n\r\n<p>2017 was a great year for WAC! The company handled more passengers than what they ever did in the 28 years of their operations. The profits were at an all-time high. Employees were happy as this was a very fruitful year after 2 years of uncertainties. The schedule for the 20th of January, 2018 is getting prepared and it has to be published to everyone by 8 PM which is only 30 minutes from now.</p>\r\n\r\n<p>All other details as on 20th of January, 2018 have been given below:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Number of resorts- 3.</p>\r\n	</li>\r\n	<li>\r\n	<p>Total number of Pilots- 6 (however, each Pilot has a balance of only 4 flying hours for this week and today is the last day of the week)</p>\r\n	</li>\r\n	<li>\r\n	<p>Number of passengers for today is 45</p>\r\n	</li>\r\n	<li>\r\n	<p>Passenger Arrival Time at A:</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>08:00 AM- 12 nos.(5 to B, 7&nbsp;&amp; to C)</p>\r\n\r\n<p>09:00 AM- 13 nos.(7 to C &amp; 6 to D)</p>\r\n\r\n<p>10:00 AM- 8 nos. (1 to B &amp; 7 to D)</p>\r\n\r\n<p>11:00 AM- 12 nos.(6 to B &amp; 6 to C)</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Penalties for exceeding PWT:</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&gt;30 minutes- 5$</p>\r\n\r\n<p>&gt;60 minutes- 10$</p>\r\n\r\n<p>&gt;90 minutes- 20$</p>\r\n\r\n<p>&gt;120 minutes- 40$</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Cost of flying:</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Cost per flying hour- 500$</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Aircrafts Availability: 3</p>\r\n	</li>\r\n</ol>\r\n', 0, '2017-02-03 21:59:14', 0, 0),
(3, 8, 'NAVIS Mess Up! ', '<p style=\"text-align:justify\">The FLYBE plane landed pretty late today, almost 3 hours behind schedule. Everyone was in a hurry to reach the seaplane check-in counter located as shown in the plan below. In this beautiful country of Lala Land passengers just cannot wait to reach their resort destinations of their choice. FLYBE is the most preferred airlines to Bathelano from Western Europe as the maximum weight that that one can carry for a single baggage is 30 lbs which is much higher than what other competing airlines provide, without any charges. Thanks to a tie-up with WAC, all relevant baggage are delivered at the WAC counter by FLYBE, directly. AC-1 seaplane was all set to fly the 10 passengers that flew in by the FLYBE international flight, to go to Resort B. All the passengers were required to provide their personal details at the WAC check-in counter to obtain the Boarding Passes. All of them were also required to identify their baggage as soon as those were offloaded by the FLYBE team at WAC counter and get them weighed for safety reasons. There is a maximum weight that is allowed free, per piece of baggage which is 32 lbs. Beyond this weight, USD 5 is charged for every extra pound (lb). In any case, no passenger can carry more than 55 lbs with him/ her. In order to make the entire process efficient the WAC management last year implemented NAVIS software application. Although NAVIS has been a very helpful tool and has saved employee and passenger times after its implementation still then software glitches have been appearing of late.</p>\r\n', 0, '2017-03-20 21:57:44', 0, 0);
INSERT INTO `game_scengeneral` (`ScenGen_ID`, `ScenGen_ScenID`, `ScenGen_Title`, `ScenGen_Content`, `ScenGen_PageOrder`, `ScenGen_DateTime`, `ScenGen_Status`, `ScenGen_Delete`) VALUES
(4, 8, 'Layout', '<p><img alt=\"\" src=\"data:image/png;base64,', 0, '2017-03-20 22:03:41', 0, 0);
INSERT INTO `game_scengeneral` (`ScenGen_ID`, `ScenGen_ScenID`, `ScenGen_Title`, `ScenGen_Content`, `ScenGen_PageOrder`, `ScenGen_DateTime`, `ScenGen_Status`, `ScenGen_Delete`) VALUES
(5, 8, 'Go/ No Go!', '<p>The rush at the WAC check-in counter had started in the meantime. One by one the passengers started handing over their baggage to WAC check-in staff for getting them weighed at the automated weighing system linked to NAVIS. In fact, the third passenger in the queue had to pay 20 USD for carrying a baggage that was beyond the allowed limit. As the 7th passenger&rsquo;s baggage was getting weighed at the check-in counter, the machine as well as the &ldquo;weight and balance&rdquo; module of NAVIS mal-functioned and it became impossible to weigh further although all other activities were not impacted by this. The weighing data till the 6th passenger could only be captured correctly. The rest of the passenger had just one luggage each. Till that point the weight was 302 lbs and 8 baggage had been weighed. Only 5 were to be weighed when this happened, unfortunately. Ten passengers for Resort B consisted of a family of 6 (2 adult males, 1 adult female, 2 children aged 10 and 12 years as well as a new born baby). All the other 5 were adult males.</p>\r\n\r\n<p>Reference Document: PASSENGER BENCHMARK WEIGHT TABLE</p>\r\n\r\n<p>WAC Manager-on-Duty is waiting for your go/ no go decision and expects that to be communicated to him in the next 60 min.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, '2017-03-20 22:16:32', 0, 0),
(6, 9, 'Another Day, Another Story!', '<p style=\"text-align:justify\">With a lot of fanfare on January 1, 2017 WAC had launched an air-conditioned Seaplane in Bathelano. Like many firsts to WAC&rsquo;s credit this was also the first time that such an initiative happened in the aviation industry of Lala Land. This new Seaplane WTL- 93 has been a huge success with the international passengers as well as domestic passengers alike. WAC&rsquo;s revenues generated by WTL-93 has beaten all expectations. It can carry a maximum of 15 passengers at any point in time. Today the VSTB terminal is busy with excited passengers. WTL- 93 route had been planned well, by you. You have scheduled 5 couples and a family of 4 (including 2 children) on WTL-93 for the ensuing flight. This WTL-93 flight is scheduled to leave at 8:00 AM to Resort B and from there to Resort C. Resorts B and C are in the same atoll and not very far from each other.As you know, Resort C is a large resort and is strategically important for WAC Business. Mr Hussain Ateef, is the owner of Resort C. Mr Ateef travels frequently because of his business interests across continents and hardly gets to spend time with family. Yesterday his family of 4 flew to Resort C for holidaying.</p>\r\n', 0, '2017-03-20 22:28:55', 0, 0),
(7, 9, 'Another Day, Another Story! (contd.)', '<p>The clock was showing 07:00 AM. As the boarding announcement was about to begin, there was a call from Mr Ateef&rsquo;s office. Mr Ateef&rsquo;s office has requested a seat for Mr Ateef in this flight as he has to reach Resort C, urgently. He was reaching WACTB by 07:30 hrs. As a principle, WAC does not refuse any request made by any premium customer and Mr Ateef was in that league. For accommodating Mr Ateef&rsquo;s request the whole scheduled as well as load analysis has to be redone. It seems the seaplane has to either reduce the amount of fuel weight planned or number of passenger(s) for the flight, if Mr Ateef&rsquo;s request has to be accepted. Thankfully, there is a refueling facility at Resort D. This facility at Resort D is managed by a third party and they charge USD 6 for 10 lbs of the right grade aviation fuel. However, the same fuel costs USD 3 for 10 lbs if filled at VSTB Resort C to D takes 10 minutes of flight time. An hour of flight time requires 600 lbs of fuel. Also, as you know, a minimum fuel reserve of 350 lb has to be maintained by the seaplane. Resort B and C both have very stringent contractual conditions against bumping of passengers and waiting time as well. In case you decide to bump any passenger because of the above last minute development then WAC will have to spend USD 1000 per passenger.</p>\r\n', 0, '2017-03-20 22:32:43', 0, 0),
(8, 14, 'Scenario One', '<center><p><iframe frameborder=\"0\" height=\"390\" src=\"https://player.vimeo.com/video/215400293\" width=\"1100\"></iframe></p></center>\r\n', 0, '2017-04-20 22:42:33', 0, 0),
(9, 15, 'Policy changes and its impact!', '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#2980b9\"><span style=\"font-size:48px\"><span style=\"font-family:Comic Sans MS,cursive\">Welcome to Scenario Two!</span></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n', 0, '2017-04-21 08:10:59', 0, 0),
(10, 15, 'Policy Changes', '<center><iframe src=\"https://player.vimeo.com/video/215400393\" width=\"700\" height=\"350\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe><center>', 0, '2017-04-21 08:11:36', 0, 0),
