(68, 27, 'Scenario Summary', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#d5ecf5; padding:10px\">\r\n<p style=\"text-align:center\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:24px\">SCENARIO SUMMARY</span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-80000 manhours to be reached by the end of 90 days.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-60000 manhours to be reached in 60 days and 80000 in 90 days.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-10% manhours to be provided by Expert OCL hires.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-30% manhours to be provided by Advanced OCL hires.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-Permanent to Temporary ratio is to be about 80:20, ideally.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-New hires through the campus channel have to be hired under permanent contracts.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\"><span style=\"color:#2e75b6\">-All mismatches have to be addressed.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; text-align:center\"><span style=\"font-size:18pt\"><span style=\"color:red\"><span style=\"font-family:Calibri\">Please click on the Input link above to provide your decisions!</span></span></span></p>\r\n</div>\r\n', 0, '2017-06-24 17:30:27', 0, 0),
(69, 35, 'Scenario Summary', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#d5ecf5; padding:10px\">\r\n<p style=\"text-align:center\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:24px\">SCENARIO SUMMARY</span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-Ten percent drop in permanent Expert OCL manhours and ten more in </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">Advanced OCL manhours because of attrition.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-Client has revised the Expert and Advanced manhour requirements to </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">90% of the last quarter, you can choose to provide more though.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-All temporary employees, both part time and full time completed their </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">contracts at the end of last quarter and left.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-Campus season is over and it is no more available as a channel for </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">sourcing candidates.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-You are allowed to use Employee Referral as a channel henceforth. You </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">can use this channel only for all Expert and Advanced level hires.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:center\"><span style=\"font-size:18pt\"><span style=\"color:red\"><span style=\"font-family:Calibri\">Please click on the Input link above to provide your decisions!</span></span></span></p>\r\n</div>\r\n', 0, '2017-06-24 17:37:36', 0, 0),
(70, 29, 'Scenario Summary', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#d5ecf5; padding:10px\">\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\"><span style=\"font-family:Comic Sans MS,cursive\">SCENARIO SUMMARY</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-No manhour lost because of unpredicted attrition.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-All temporary employees, both part time and full time, completed their </span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">contracts at the end of last quarter and left.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-Management wants diversity in the employee base to improve.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-You have to hire diversity candidates against all temporary positions that </span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">are currently vacant.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-They all will be hired as Trainable OCL employees.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2e75b6\">-50000 Cheries will be spent extra on their initial training. </span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18pt\"><span style=\"color:red\"><span style=\"font-family:Calibri\">Please click on the Input link above to provide your decisions!</span></span></span></p>\r\n</div>\r\n', 0, '2017-06-24 17:43:04', 0, 0),
(71, 30, 'Scenario Summary', '<div class=\"jqDnR\" id=\"idTextPanel\" style=\"background-color:#d5ecf5; padding:10px\">\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\"><span style=\"font-family:Comic Sans MS,cursive\">SCENARIO SUMMARY</span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-No manhour lost because of unpredicted attrition.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-All temporary employees, both part time and full time completed their </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">contracts at the end of last quarter and left.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-Management wants to move to a global delivery model and wants hiring to&nbsp;</span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">be done in Lyka city.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-Management wants initially to hire only diversity candidates to create an aspirational brand in the new place.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">-You have to hire using Manpower Agency (Job Fair) and Employee Referral </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">channels, in Lyka city against all the temporary positions that have fallen </span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\"><span style=\"color:#2e75b6\">vacant.</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; text-align:center\"><span style=\"font-size:18pt\"><span style=\"color:red\"><span style=\"font-family:Calibri\">Please click on the Input link above to provide your decisions!</span></span></span></p>\r\n</div>\r\n', 0, '2017-06-24 17:46:02', 0, 0),
